import { timeInSeconds, compare } from './util';
import Song from './song.js';

export default function SongList(props){
    var finalList = [...songData];
    if(props.lengthFilter){
        var newList = [];
        for (const item in finalList){
            if(timeInSeconds(item.minutes, item.seconds) <= props.length){
                newList.push(item);
            }
        }
        finalList = newList;
    }
    var newList = [];
    for (const item in finalList){
        if(props.artists[item.artist] == true){
            newList.push(item);
        }
    }
    finalList = newList;
    if(props.sort){
        finalList.sort(compare);
    }
    return (
        <div>
            {songData.map((song, index) => (
        <Song item={song}/>
      ))}
        </div>
